import React from 'react';
import {Container, Card} from 'react-bootstrap';

const Body = () => {
  return (
    <div>
         <Container className="mt-3" style={{ border: '1px solid #ccc', borderRadius: '5px', backgroundColor: 'blue' }}>
        <Card>
          <Card.Body>
            <Card.Title>Weather in [City Name]</Card.Title>
            <Card.Subtitle className="mb-2 text-muted">Date and Time</Card.Subtitle>
            <Card.Text>Weather description and other details here.</Card.Text>
          </Card.Body>
        </Card>
      </Container>


    </div>
  );
}

export default Body;
